INSERT INTO `Class` VALUES (1,'Yoga','A practice that combines physical postures, breathing exercises, and meditation to promote relaxation and improve flexibility and strength.'),(2,'Zumba','A high-energy dance fitness program that incorporates Latin and international music, providing an enjoyable workout experience. Who said you can\'t dance and exercise!'),(3,'CrossFit','A fitness regimen that combines elements of weightlifting, gymnastics, and cardiovascular exercises to enhance overall physical fitness and performance.'),(4,'Pilates','A low-impact exercise system that focuses on developing a strong core, improving flexibility, and promoting body alignment.'),(5,'Weightlifting','A form of strength training that uses weights for resistance to build and tone muscles.'),(6,'Cardio','A cardiovascular exercise that involves continuous rhythmic movements to elevate heart rate and improve stamina.'),(7,'Gymnastics','A sport involving exercises that require strength, balance, flexibility, agility, endurance, and control.'),(8,'Swimming','A water-based activity that involves swimming strokes and techniques for physical fitness and recreation.'),(9,'Cycling','An exercise activity that involves cycling on stationary bikes, often in a group setting with music for motivation.'),(10,'Salsa','A social dance style that originated in Latin America, characterized by energetic movements and hip-swaying.'),(11,'Pole Dancing','A form of dance that combines dance and acrobatics around a vertical pole, focusing on strength and flexibility.'),(12,'Boxing','A combat sport that involves punching, kicking, and other movements for self-defense and physical fitness.'),(13,'Martial Arts','Various disciplines and combat practices for self-defense, physical fitness, and mental discipline.'),(14,'Boot Camp','A high-intensity workout program that involves various exercises to improve strength and cardiovascular fitness.'),(15,'HIIT (High-Intensity Interval Training)','A training method that alternates between short bursts of intense exercise and periods of rest or low-intensity exercise.'),(16,'Aerobics','A form of exercise that combines Pilates and boxing movements for a full-body workout.'),(17,'Piloxing (Pilates and Boxing)','A striking sport that involves kicking and punching for self-defense, fitness, and competition.'),(18,'Kickboxing','A fitness program that uses a ballet-inspired workout focusing on isometric movements and core strength.'),(19,'Barre','A suspension training exercise that uses bodyweight exercises to develop strength, balance, and flexibility.'),(20,'TRX Training','An indoor cycling class that simulates outdoor cycling, providing an intense cardiovascular workout.'),(21,'Spin/Cycle','A high-intensity step aerobics workout that uses a raised platform for cardiovascular fitness and lower body toning.'),(22,'Step Aerobics','A type of strength training that uses bodyweight exercises to build muscle and improve flexibility.'),(23,'Bodyweight Training','A type of weight training that uses kettlebells, cast-iron weights with a handle, for strength and cardiovascular conditioning.'),(24,'Kettlebell Training','A high-energy group fitness class that involves performing weightlifting movements to music for a full-body workout.'),(25,'Body Pump','A functional training approach that focuses on movements that mimic everyday activities for improved fitness and strength.'),(26,'Functional Training','A Chinese martial art that involves slow, controlled movements and deep breathing for physical and mental benefits.'),(27,'Tai Chi','A fitness group that engages in hiking activities to explore nature, improve fitness, and enjoy outdoor adventures.'),(28,'Hiking Club','A dance-based workout program that incorporates various dance styles for a fun and energetic exercise experience.'),(29,'Dance Fitness','A Zumba variation that includes toning exercises using light weights to target specific muscle groups.'),(30,'Zumba Toning','A high-intensity interval training program that involves short bursts of intense exercise and even shorter rest periods.'),(31,'Tabata Training','An aerobic workout performed in a pool, combining water resistance and movement for low-impact fitness.'),(32,'Water Aerobics','A form of exercise that involves rowing on a machine for cardiovascular fitness and full-body strength.'),(33,'Rowing','A form of exercise that focuses on building muscle and strength through resistance training.'),(36,'Powerlifting','A physical discipline that involves overcoming obstacles by running, jumping, and climbing in a creative way.'),(37,'Parkour','An exercise routine that uses a hula hoop for fitness and fun, targeting the core and improving coordination.'),(38,'Hula Hooping','A dance form that focuses on isolating and articulating movements of the torso, hips, and arms.'),(39,'Belly Dancing','A Brazilian martial art that combines elements of dance, acrobatics, and music for self-defense and culture.'),(40,'Capoeira','A combination of yoga and aerial arts, performed using a hammock or swing for support and acrobatic movements.'),(41,'Aerial Yoga','A form of rock climbing that involves climbing short and difficult routes without the use of safety ropes.'),(42,'Bouldering','A type of exercise that involves explosive movements to improve power and athletic performance.'),(43,'Plyometrics','A form of rock climbing that takes place on artificial climbing walls for recreational and competitive purposes.'),(44,'Indoor Climbing','A full-body workout that involves standing on a paddleboard and using a paddle to move across the water.'),(45,'Paddleboarding','A form of self-defense and military martial art developed in Israel, focusing on real-world situations.'),(46,'Krav Maga','A military self-defense and fighting system developed in Israel, emphasizing practical and instinctive techniques for real-world situations.');
